import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

export default function HOOKS() {

  const nameChangeHandler = (e) =>{
     console.log(e.target.value);
  }
  const emailChangeHandler = (e) =>{
    console.log(e.target.value);
 }
 const passwordChangeHandler = (e) =>{
  console.log(e.target.value);
}
const formSubmitHandler = (e) =>{
 console.log("form is submitted ");
 e.preventDefault();
}

  return (
     <div>
      <div className='row'>
      <div className='col-md-6 offset-3 p-3'>
      <Form action="" onChange={formSubmitHandler}>
      <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Name</Form.Label>
      <Form.Control type="text" placeholder="Enter name" required onChange={nameChangeHandler} />
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Email address</Form.Label>
      <Form.Control type="email" placeholder="Enter email" required onChange={emailChangeHandler} />
    </Form.Group>

    <Form.Group className="mb-3" controlId="formBasicPassword">
      <Form.Label>Password</Form.Label>
      <Form.Control type="password" placeholder="Password" required onChange={passwordChangeHandler} />
    </Form.Group>
    <Button variant="primary" type="submit">
      Register
    </Button>
  </Form>
        </div>
      </div>
     </div>

  )
}
